import React from 'react';
import {Link} from 'react-router-dom';

const VolunteerSplash = () => {
	return(
		<div className="volunteerSplash gridCenter">
			<Link to="/volunteer">
				<div className="gridCenter primaryButton">
					Donate
				</div>
			</Link>
		</div>
	);
};
export default VolunteerSplash;
